import React from "react";
import MovieCard from "../../commons/MovieCard/MovieCard";

import "./grid.css"

const Grid = ({ types }) => {

    return (

        <ul className="template_grid">
            {types.map((type, i) => (
                <MovieCard key={i} movie={type} />
            ))}
        </ul>

    )
};

export default Grid;
